import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import { BrowserRouter, Route, Routes} from 'react'

function App() {
  return (
    <div className="App">
      <Header />
      <div className="container">
        <Top />
        <div className="contents">
          <Aside />
          <Main />
        </div>
      </div>
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(
    <App />,
  rootElement
);
